import React from 'react';
import '../index.css';
import { Button } from './Button';
import '../App.css';
import './Main.css';
import ParticleBackground from './ParticleBackground';


function Main() {
    return (
        <div className='main-container'>
            <ParticleBackground/>
            <div className='left-container'>
                <h1 className='text-8xl'>Hi! I'm Dev Patel</h1>
                <p className='text-2xl'>Computer Science | Business | UNC</p>
                <Button buttonStyle='btn--primary' buttonSize='btn--large'>
                    DISCOVER MORE
                </Button>
            </div>
            <div className='right-container'>
                <img src="/public/images/pic.jpg" alt="Me"></img>
            </div>
        </div>
    )
}

export default Main
